import React, { Component } from "react";


const Usercard = props => {
    return (
        <div className="name">
            <h1>{props.name}</h1>
            <div className="fromjobtitle">
            <ul>
                <h4>
                 From:   {props.city}
                </h4>
                <h4>
                 Job Title: {props.title}
                </h4>
                <h4>
                    Employer: {props.employer}
                </h4>
            </ul>
            </div>
            <div className="movies">
                Favorite Movies:
                <ul>
                    {props.favoriteMovies}
                </ul>
            </div>
        </div>
    )
}

export default Usercard;
